import React from 'react';
import { Link, Route } from 'react-router-dom';
import '../css/NavDiscover.css';
import EngagementsFR from './EngagementsFR';
import KnowledgeFR from './KnowledgeFR';
import CharteFR from './CharteFR';

const routes = [
    {
        path: "/discoverfr/engagements",
        component: EngagementsFR,
        title: 'lol'
    }
]

export default function NavDiscover(props) {
    return (
        <div>
            <div className='title'>
                <h1>{props.title}</h1>
            </div>
        <div className='container-fluid'>
        <div className='row' style={{marginTop:'3vh'}}>
            <div className='col-xl-3 col-md-12'>
        <div className='nav-discover'>
            <Link to='/discoverfr/engagements'><h1>ENGAGEMENTS</h1></Link>
            <Link to='/discoverfr/knowledge'><h1>SAVOIR-FAIRE</h1></Link>
            <Link to='/discoverfr/charte'><h1>CHARTE DE DEVELOPPEMENT DURABLE</h1></Link>
            </div>
        </div>
        <div className='col-xl-9' style={{marginTop:'2vh'}}>
            
            {routes.map(({ path, component: C, title }) =>(
                <Route
                path={path} 
                component={(props => <C {...props} title='title' />)}
                />
            ))}
        
        </div>
        </div>
        </div>
        </div>
    )
}
